(830,'2019-07-06 15:33:49','231','ID: 231 (atomic structure)',2,'[{\"added\": {\"name\": \"synthesis method\", \"object\": \"ID: 145\"}}, {\"added\": {\"name\": \"comment\", \"object\": \"Select suitable single crystals in an argon-filled drybox (<1 ppm O2 and H2O) under a microscope and seal in quartz capillaries. Collect data at room temperature on an Enraf-Nonius CAD4 diffractometer with graphite-monochromatized Mo Ka radiation. Obtain unitcell parameters and the crystal orientation matrix by a least-squares fit of 25 reflections with 18\\u00b0 < 2\\u03b8 < 30\\u00b0. Monitor intensity control reflections every 5000s during the data collection. Little to no degradation was observed for the compounds. Use the NRCVAX 386 PC version program for structural solution and refinement.\"}}]',34,1),
