(7076,'2022-09-20 04:23:58','2034','ID: 2034 (atomic structure)',2,'[{\"added\": {\"name\": \"comment\", \"object\": \"Differential scanning calorimetry (DSC):\\r\\n\\r\\nA TA Discovery DSC 2500 was used to carry out low-temperature conventional differential scanning calorimetry (DSC) measurements. The instrument was under helium purge with a 5 K/min ramp from 298 K to 124 K and back to 298 K (with use of an LN2P cooler). Sample powder was loaded into a Tzero Hermetic aluminum pan, with temperature and enthalpy calibrated in advance.\\r\\n\\r\\nA similar instrument was used to perform high-temperature DSC measurements under nitrogen purge. The ramp rate was 5 K/min from 298 K to 593 K. An aluminum pan was hermetically sealed to contain samples.\\r\\n\\r\\nThe Flash DSC-1 instrument was used for ultrafast DSC measurements (Mettler Toledo). The UFS-1 chip-sensor was mounted and conditioned in the instrument, corrected in the range of 173 K to 723 K. (S-2-MeBA)2PbI4 crystals were placed on a glass slide, a single crystal flake isolated attached to the chip and set beneath an optical microscope. Silicon oil (type 47 V, 60,000) was applied to strengthen the thermal contact between the chip and crystal.\"}}]',34,101),
(7077,'2022-09-20 04:24:36','2035','ID: 2035 (atomic structure)',2,'[{\"added\": {\"name\": \"comment\", \"object\": \"Differential scanning calorimetry (DSC):\\r\\n\\r\\nA TA Discovery DSC 2500 was used to carry out low-temperature conventional differential scanning calorimetry (DSC) measurements. The instrument was under helium purge with a 5 K/min ramp from 298 K to 124 K and back to 298 K (with use of an LN2P cooler). Sample powder was loaded into a Tzero Hermetic aluminum pan, with temperature and enthalpy calibrated in advance.\\r\\n\\r\\nA similar instrument was used to perform high-temperature DSC measurements under nitrogen purge. The ramp rate was 5 K/min from 298 K to 593 K. An aluminum pan was hermetically sealed to contain samples.\\r\\n\\r\\nThe Flash DSC-1 instrument was used for ultrafast DSC measurements (Mettler Toledo). The UFS-1 chip-sensor was mounted and conditioned in the instrument, corrected in the range of 173 K to 723 K. (S-2-MeBA)2PbI4 crystals were placed on a glass slide, a single crystal flake isolated attached to the chip and set beneath an optical microscope. Silicon oil (type 47 V, 60,000) was applied to strengthen the thermal contact between the chip and crystal.\"}}]',34,101),
(7078,'2022-09-20 04:26:49','2037','ID: 2037 (atomic structure)',2,'[{\"added\": {\"name\": \"comment\", \"object\": \"Differential scanning calorimetry (DSC):\\r\\n\\r\\nA TA Discovery DSC 2500 was used to carry out low-temperature conventional differential scanning calorimetry (DSC) measurements. The instrument was under helium purge with a 5 K/min ramp from 298 K to 124 K and back to 298 K (with use of an LN2P cooler). Sample powder was loaded into a Tzero Hermetic aluminum pan, with temperature and enthalpy calibrated in advance.\\r\\n\\r\\nA similar instrument was used to perform high-temperature DSC measurements under nitrogen purge. The ramp rate was 5 K/min from 298 K to 603 K. An aluminum pan was hermetically sealed to contain samples.\"}}]',34,101),
(7079,'2022-09-20 04:27:45','2036','ID: 2036 (atomic structure)',2,'[{\"added\": {\"name\": \"comment\", \"object\": \"Quenching:\\r\\n\\r\\nWhen (S-2-MeBA)2PbI4 crystals are cooled quickly through quenching, their structural transition is avoided. Quenching was performed by precooling the SC-XRD space to 100 K and directly applying the mounted crystal onto the goniometer head. The structure symmetry was then analyzed using PLATON, revealing that the full structure, isolated inorganic sublattice, and orientation of organic cations remained primarily unchanged.\\r\\n\\r\\n\\r\\nDifferential scanning calorimetry (DSC):\\r\\n\\r\\nA TA Discovery DSC 2500 was used to carry out low-temperature conventional differential scanning calorimetry (DSC) measurements. The instrument was under helium purge with a 5 K/min ramp from 298 K to 124 K and back to 298 K (with use of an LN2P cooler). Sample powder was loaded into a Tzero Hermetic aluminum pan, with temperature and enthalpy calibrated in advance.\\r\\n\\r\\nA similar instrument was used to perform high-temperature DSC measurements under nitrogen purge. The ramp rate was 5 K/min from 298 K to 593 K. An aluminum pan was hermetically sealed to contain samples.\\r\\n\\r\\nThe Flash DSC-1 instrument was used for ultrafast DSC measurements (Mettler Toledo). The UFS-1 chip-sensor was mounted and conditioned in the instrument, corrected in the range of 173 K to 723 K. (S-2-MeBA)2PbI4 crystals were placed on a glass slide, a single crystal flake isolated attached to the chip and set beneath an optical microscope. Silicon oil (type 47 V, 60,000) was applied to strengthen the thermal contact between the chip and crystal.\"}}]',34,101),
