INSERT INTO `materials_experimentaldetails` VALUES
(9,'2019-03-24 18:24:01.138210','2022-03-29 19:58:12.737864','UV-Vis absorption (diffuse reflectance)','UV-Visible-NIR spectrophotometer (Shimadzu UV-3600) with integrating sphere attachment (ISR-3100) operating in the 300–1500 nm region. Highly refined barium sulfate powder (Wako, pure) was used as a reflectance standard. Optical absorption coefficient was determined according to the Kubelka–Munk equation. In this manner, optical band gaps for the perovskites were determined. Refer to Page 9300 Section 3.1 Paragraph 3; Figure 3,4.',1,129,75,1),
(42,'2019-04-08 21:05:32.416278','2022-03-21 20:19:48.321959','Temperature-dependent Guinier-Simon photograph','Not specified.',1,166,75,1),
(43,'2019-04-08 21:11:31.616993','2022-03-21 20:23:34.696773','Temperature-dependent Guinier-Simon photograph','Not specified.',1,167,75,1),
(44,'2019-04-08 21:15:04.573821','2022-03-21 20:25:16.060968','Temperature-dependent Guinier-Simon photograph','Not specified.',1,168,75,1),
(46,'2019-04-09 01:27:02.751196','2022-03-21 20:52:30.591325','Powder X-ray diffraction','Bruker D8 Advance diffractometer (Bragg–Brentano geometry) equipped with a Cu-Ka X-ray tube operated at 40 kV and 40 mA. Refer to Page 9300 Section 3.1 Paragraph 2.',1,170,75,1),
(48,'2019-04-09 01:48:04.156353','2022-03-21 21:22:42.904631','Single crystal X-ray diffraction','CAD-4 four-circle diffractometer; Mo Kα, λ = 0.70926 Å (graphite monochromator); T = 18 °C. Lorentz, polarization, and absorption corrections applied. Refer to page 413 Experimental.',1,172,75,1),
(128,'2019-06-09 21:01:42.929191','2019-06-09 21:05:03.979214','2H and 14N NMR','Measurements were carried out at 8.48 T with a Nicolet 360NB spectrometer using a broad band (16-58 MHz) variable-temperature 10 mm probe supplied by Nicolet. The 2-H and 14-N frequencies were 55.427 and 26.083 MHz, respectively. Refer to Page 414 Results section Existence of transitions subsection.',1,434,1,1),
(131,'2019-06-09 21:17:49.375207','2019-06-09 21:17:49.374861','Adiabatic calorimetry','The heat capacities were measured in an adiabatic calorimeter from 30 to 345 K, using sample masses of 14.6883 g MAPbCl3. Refer to Page 414 Table 1.',1,437,1,1),
(134,'2019-06-09 22:01:17.230546','2022-03-29 22:13:17.065228','2H and 14N NMR','2H and 14N NMR spectra were recorded at 55.4257 and 26.083 MHz, respectively, on a Nicolet 360 NB spectrometer (B0 = 8.48 T). Refer to Page 581.',1,440,75,1),
(135,'2019-06-17 00:43:46.844046','2022-03-29 22:33:16.640509','Adiabatic calorimetry','The heat capacities were measured with a computerized adiabatic calorimeter [1, 2]. The temperature ranges of the measurement were between 13 and 300 K. The mass of the calorimetric sample was 6.0483 g.',1,441,75,1),
(140,'2019-06-18 15:41:21.496503','2019-06-18 15:41:21.496178','Temperature-dependent Guinier-Simon photograph','No method specified. Refer to Page 6374 Table I.',1,446,1,1),
(159,'2019-07-08 02:20:50.361504','2022-03-29 22:47:16.758057','Single-crystal X-ray diffraction','A colorless single crystal of dimensions 0.09 mm X 0.18 mm X 0.27 mm was used. A full sphere of data was collected at room temperature on a Bruker SMART CCD diffractometer, equipped with a normal focus 2.4 kW sealed tube X-ray source (Mo Kα radiation, λ = 0.71073 Å). Refer to page 695 for details.',1,216,75,1),
(168,'2019-07-14 18:09:33.841617','2022-03-30 20:50:11.211231','Photoluminescence','The photoluminescence spectra were measured using a Horiba-Jobi-Yvon LabRAM ARAMIS system, with a 325 nm He-Cd laser excitation. The laser beam was collimated and focused through a 40X UV objective onto the sample surface at room temperature. Refer to figure 5.',1,377,75,1),
(169,'2019-07-14 18:09:36.252380','2022-03-30 19:40:27.320677','Photoluminescence','The photoluminescence spectra were measured using a Horiba-Jobi-Yvon LabRAM ARAMIS system, with a 325 nm He-Cd laser excitation. The laser beam was collimated and focused through a 40X UV objective onto the sample surface at room temperature. Refer to figure 5.',1,11,75,1),
(455,'2020-05-17 16:06:16.743098','2022-03-29 01:30:51.231766','UV-Vis absorption','Optical absorption spectra were obtained using a Shimadzu UV-3600 spectrophotometer.',1,869,75,1),
(1324,'2021-10-26 20:50:46.744685','2022-03-30 21:37:23.870059','UV-Vis absorption','Optical absorption spectra were obtained using a Shimadzu UV-3600 spectrophotometer.',66,1904,75,1),
(1345,'2022-03-21 18:49:18.936345','2022-03-21 18:49:18.936098','Single crystal X-ray diffraction','The crystal was mounted on the glass capillary and fixed with epoxy resin. Crystallographic data were collected using a Rigaku RAXIS-RAPID diffractometer with Mo-Kα (λ = 0.71073 Å) radiation from a graphite monochromator. Structural refinements were performed using the full-matrix least-squares method on F2. The calculations were carried out with the Yadokari-XG software.',75,1793,75,1),
(1346,'2022-03-22 19:19:59.036909','2022-03-22 19:21:39.460928','Photoluminescence measurement at 300 K','PL spectrum was recorded with a HORIBA iHR-550 spectrometer, liquid-nitrogen cooled CCD detector, and semiconductor laser operated at 266 nm.',75,1942,75,1),
(1347,'2022-03-22 19:35:15.459579','2022-03-22 19:40:47.164328','UV-Vis absorption','The spectrum was recorded using a combination of a HOROBA iHR-550 spectrometer, Xenon lamp, and liquid-nitrogen cooled CCD detector',75,1943,75,1),
(1349,'2022-03-22 20:05:11.464226','2022-03-22 20:05:11.464016','Photoluminescence measurement at 300 K','PL spectrum was recorded with a HORIBA iHR-550 spectrometer, liquid-nitrogen cooled CCD detector, and semiconductor laser operated at 266 nm.',75,1945,75,1),
(1717,'2023-05-19 20:21:38.057864','2023-05-19 20:21:38.057244','Powder X-ray diffraction (PXRD)','X-ray powder diagrams collected with a Debye-Scherrer camera using Cu K-alpha radiation (wave length 1.54178 Angstrom).',8,2277,8,1),
(1774,'2023-06-09 03:34:56.387869','2023-06-09 03:34:56.387640','Electroabsorption','Films were spin-coated onto interdigitated Au electrode array - 45 micron distance between opposing fingers. Samples mounted in cryostat with Cu wires soldered to opposing electrode stripes. Xe lamp light spectrally filtered, focused on sample and subsequently on UV-enhanced Si photodiode detector. Sample transmission, substrate transmission, and sample electrotransmission were collected in independent scans. Absorbance and electroabsorbance were then calculated from the respective transmissions.\r\n\r\nThe fundamental gap is determined by the crossover point of absorption curves measured under different electric fields in the fundamental band gap region.',130,2334,130,1),
(1775,'2023-06-09 03:36:15.555059','2023-06-09 03:36:15.554838','Electroabsorption','Films were spin-coated onto interdigitated Au electrode array - 45 micron distance between opposing fingers. Samples mounted in cryostat with Cu wires soldered to opposing electrode stripes. Xe lamp light spectrally filtered, focused on sample and subsequently on UV-enhanced Si photodiode detector. Sample transmission, substrate transmission, and sample electrotransmission were collected in independent scans. Absorbance and electroabsorbance were then calculated from the respective transmissions. The exciton binding energy arises as the difference of the 1s exciton peak energy observed in conventional absorption and the fundamental gap as determined by the crossover point of absorption curves measured under different electric fields in the fundamental band gap region.',130,2335,130,1),
(1776,'2023-06-09 03:37:10.975691','2023-06-09 03:37:10.975469','Electroabsorption','Films were spin-coated onto interdigitated Au electrode array - 45 micron distance between opposing fingers. Samples mounted in cryostat with Cu wires soldered to opposing electrode stripes. Xe lamp light spectrally filtered, focused on sample and subsequently on UV-enhanced Si photodiode detector. Sample transmission, substrate transmission, and sample electrotransmission were collected in independent scans. Absorbance and electroabsorbance were then calculated from the respective transmissions.',130,2336,130,1),
(1798,'2023-07-27 02:03:35.678514','2023-07-27 02:03:35.678285','Electroabsorption','Films were spin-coated onto interdigitated Au electrode array - 45 micron distance between opposing fingers. Samples mounted in cryostat with Cu wires soldered to opposing electrode stripes. Xe lamp light spectrally filtered, focused on sample and subsequently on UV-enhanced Si photodiode detector. Sample transmission, substrate transmission, and sample electrotransmission were collected in independent scans.Absorbance and electroabsorbance were then calculated from the respective transmissions.\r\n\r\nThe fundamental gap is determined by the crossover point of absorption curves measured under different electric fields in the fundamental band gap region.',130,2357,130,1),
(1799,'2023-07-27 02:05:57.584874','2023-07-27 02:05:57.584624','Electroabsorption','Films were spin-coated onto interdigitated Au electrode array - 45 micron distance between opposing fingers. Samples mounted in cryostat with Cu wires soldered to opposing electrode stripes. Xe lamp light spectrally filtered, focused on sample and subsequently on UV-enhanced Si photodiode detector. Sample transmission, substrate transmission, and sample electrotransmission were collected in independent scans. Absorbance and electroabsorbance were then calculated from the respective transmissions. The exciton binding energy arises as the difference of the 1s exciton peak energy observed in conventional absorption and the fundamental gap as determined by the crossover point of absorption curves measured under different electric fields in the fundamental band gap region.',130,2358,130,1),
(1800,'2023-07-27 02:07:46.598615','2023-07-27 02:07:46.598361','Electroabsorption','Films were spin-coated onto interdigitated Au electrode array - 45 micron distance between opposing fingers. Samples mounted in cryostat with Cu wires soldered to opposing electrode stripes. Xe lamp light spectrally filtered, focused on sample and subsequently on UV-enhanced Si photodiode detector. Sample transmission, substrate transmission, and sample electrotransmission were collected in independent scans. Absorbance and electroabsorbance were then calculated from the respective transmissions.',130,2359,130,1);
