INSERT INTO `materials_synthesismethod` VALUES
(3,'2019-03-24 18:24:01.129227','2019-06-09 02:19:53.237113','Lead(II) acetate (Chemical Reagents, Sigma), concentrated aqueous HCl, CH3NH2 (40% soluble in water, Merck)','MAPbCl3 single crystal ~1mm, colorless','Precipitate polycrystalline MAPbCl3 from a halogenated acid solution using the method of [1]. Dissolve 1.88 g of lead(II) acetate in 40 ml concentrated to 37 wt% HCl aqueous solution warmed (~90 °C) in a water bath. Then add an excess of HCl to prevent the co-precipitation of PbCl2 in agreement with previous work [2], along with 0.45 g CH3NH2. Crystallize by cooling the solution from 90 °C to room temperature over 3 hours. Wash product with acetone and dry overnight at 100 °C in a vacuum oven. Obtain larger crystals via slow cooling from 90 to 50 °C over 3 days. Refer to Page 9299 Section 2.1 Synthesis; Figure 2.',1,129,1,1),
(34,'2019-04-08 21:11:31.612304','2022-03-29 17:56:43.560470','lead (II) acetate, CH3NH3+ (by adding a 40% solution of CH3NH2 in water), concentrated HCl','Colorless MAPbCl3 crystals','CH3NH3PbCI3 was synthesized from lead (II) acetate and CH3NH3+ dissolved in concentrated HCl solution. The aqueous solution was cooled from l00°C to room temperature to obtain the colorless crystals.',1,167,75,1),
(35,'2019-04-08 21:15:04.568843','2022-03-29 17:55:47.498911','lead (II) acetate, CH3NH3+ (by adding a 40% solution of CH3NH2 in water), concentrated HCl','Colorless MAPbCl3 crystals','CH3NH3PbCI3 was synthesized from lead (II) acetate and CH3NH3+ dissolved in concentrated HCl solution. The aqueous solution was cooled from l00°C to room temperature to obtain the colorless crystals.',1,168,75,1),
(37,'2019-04-09 01:27:02.746213','2022-03-21 20:39:53.543863','Lead(II) acetate (Chemical Reagents, Sigma), concentrated aqueous HCl, CH3NH2 (40% soluble in water, Merck)','Colorless MAPbCl3 Single crystal ~1mm','Precipitate polycrystalline MAPbCl3 from a halogenated acid solution using the method of [1]. Dissolve 1.88 g of lead(II) acetate in 40 ml concentrated aquous HCl solution (37 wt%) warmed (~90 °C) in a water bath. Then add an excess of HCl to prevent the co-precipitation of PbCl2 in agreement with previous work [2], along with 0.45 g CH3NH2. Crystallize by cooling the solution from 90 °C to room temperature over 3 hours. Wash product with acetone and dry overnight at 100 °C in a vacuum oven. Obtain larger crystals via slow cooling from 90 to 50 °C over 3 days.',1,170,75,1),
(39,'2019-04-09 01:48:04.150248','2022-03-29 21:01:19.811553','HCl, CH3NH2, PbCl2','MAPbCl3 Single-crystal','Primarily referenced the methods of [1] and [2]. The synthesis of MAPbBr3 in ref [2] was modified to prepare MAPbCl3.',1,172,75,1),
(100,'2019-05-10 15:09:05.411991','2022-03-29 17:56:19.938246','lead (II) acetate, CH3NH3+ (by adding a 40% solution of CH3NH2 in water), concentrated HCl','Colorless MAPbCl3 crystals','CH3NH3PbCI3 was synthesized from lead (II) acetate and CH3NH3+ dissolved in concentrated HCl solution. The aqueous solution was cooled from l00°C to room temperature to obtain the colorless crystals.',1,166,75,1),
(113,'2019-06-09 21:01:42.924921','2022-03-29 21:49:56.584075','HCl, CD3NH2, PbCl2','CD3NH3PbCl3 crystals','Primarily referenced the methods of [1] and [2]. The synthesis of MAPbBr3 in ref [2] was modified to prepare CD3NH3PbCl3.',1,434,75,1),
(116,'2019-06-09 21:17:49.373037','2022-03-29 21:18:37.571298','HCl, CH3NH2, PbCl2','MAPbCl3 Single-crystal','Primarily referenced the methods of [1] and [2]. The synthesis of MAPbBr3 in ref [2] was modified to prepare MAPbCl3.',1,437,75,1),
(119,'2019-06-09 22:01:17.228490','2022-03-29 22:13:17.059072','Not specified','MAPbCl3 single crystals','The procedure mentioned in ref [1] for MAPbBr3 was modified. A D2O-H2O mixture was used to prepare the N-deuterated samples.',1,440,75,1),
(120,'2019-06-17 00:43:46.840989','2022-03-29 22:37:00.014600','Pb(CH3CO2)2, MACl','Colorless MAPbCl3 cube-shaped crystals of 1-2 mm from the edge','Add aqueous solution of Pb(CH3CO2)2 drop by drop to an excess quantity of hot aqueous MACl solution and cool slowly to 5 °C.',1,441,75,1),
(125,'2019-06-18 15:41:21.495250','2022-03-29 17:55:06.539499','lead (II) acetate, CH3NH3+ (by adding a 40% solution of CH3NH2 in water), concentrated HCl','Colorless MAPbCl3 crystals','CH3NH3PbCI3 was synthesized from lead (II) acetate and CH3NH3+ dissolved in concentrated HCl solution. The aqueous solution was cooled from l00°C to room temperature to obtain the colorless crystals.',1,446,75,1),
(152,'2019-07-08 02:20:50.360557','2019-07-08 02:20:50.360363','PbCl2, HCl, methanol, phenethylamine','Small block-like crystals to larger plate-like crystals','Layered solution approach.\r\n\r\nGrow crystals within a long, straight, glass tube (Refer to Fig. 1). First dissolve 1.0 mmol (0.278 g) of freshly sublimed PbCl2 (Aldrich; 99.999%) in 7.5 ml concentrated (37 wt %) aqueous HCl (Aldrich; 99.999%). Weigh and add PbCl2 to the tube in an argon-filled glove box, with oxygen and water levels maintained below 1 ppm. Cover the tube with a septum before removing the glove box and adding HCl with a syringe. \r\n\r\nCreate a second layer in the crystal tube by gently syringing 15 ml of methanol (Aldrich; anhydrous, 99.8%) on top of the HCl/PbCl2 solution. A relatively sharp interface can be created between the solvent layers due to density differences. On top of the column, add a stoichiometric amount (2 mmol or approximately 0.25 ml) of phenethylamine with a syringe. \r\n\r\nIn the experiment, the phenethylamine rapidly dispersed in the methanol but, because of the sharp interface with the HCl solution, formation of the final (C6H5C2H4NH3)2PbCl4 product was very slow. The crystals were isolated after approximately one year by removing the solvent with a syringe and drying the crystals under vacuum at room temperature and later stored in an argon glove box.',1,216,1,1),
(161,'2019-07-14 18:09:33.840823','2022-03-30 20:50:11.207507','(PEA)2PbCl4 crystals, DMF, quartz substrates','Thin film on quartz','Dissolve the 2D single crystals into DMF at a concentration 6%∼10% relative to the total weight. Spin-coat at 3000 rpm for 30 s on quartz substrates. Anneal in air at 100 °C for 10 min before measurement.',1,377,75,1),
(162,'2019-07-14 18:09:36.251617','2022-03-30 19:40:27.315226','(PEA)2PbCl4 crystals, DMF, quartz substrates','Thin film on quartz','Dissolve the 2D single crystals into DMF at a concentration 6%∼10% relative to the total weight. Spin-coat at 3000 rpm for 30 s on quartz substrates. Anneal in air at 100 °C for 10 min before measurement.',1,11,75,1),
(472,'2020-05-17 16:06:16.742464','2022-03-30 21:17:05.265560','(PEA)2PbCl4 crystals, DMF, quartz substrates','Thin film on quartz','Dissolve the 2D single crystals into DMF at a concentration 6%∼10% relative to the total weight. Spin-coat at 3000 rpm for 30 s on quartz substrates. Anneal in air at 100 °C for 10 min before measurement.',1,869,75,1),
(1111,'2020-12-23 01:44:14.335590','2022-09-17 14:09:56.395217','MACl (TCI, >98.0%), PbCl2 (Aldrich, 98.0%), dimethyl sulfoxide (DMSO) (Wako), and N, N-dimethylformamide (DMF) (Wako)','Single crystalline colorless MAPbCl3 with the size of several hundred micrometers','Optical trapping induced crystallization:\r\n1:1 MACl/PbCl2 (1.0 M) were dissolved in DMSO: DMF solvent mixture (1:1, v-v) to prepare the precursor solution. The solution was centrifuged at 10,000 r.p.m for 5 min; the supernatant was used for further experiments. \r\n10 μL of the supernatant solution was used to prepare a thin layer (100-200 um thickness) in a laboratory-built sample chamber. A near-infrared (NIR) laser (Spectron Laser System, λ = 1064 nm) was focused onto the solution surface through an objective lens at 60 times magnification (Olympus UPlanFLN with a numerical aperture of 0.90).',47,1793,101,1),
(1235,'2021-10-26 20:50:46.743977','2022-03-30 21:37:23.865893','(PEA)2PbCl4 crystals, DMF, quartz substrates','Thin film on quartz','Dissolve the 2D single crystals into DMF at a concentration 6%∼10% relative to the total weight. Spin-coat at 3000 rpm for 30 s on quartz substrates. Anneal in air at 100 °C for 10 min before measurement.',66,1904,75,1),
(1258,'2022-03-22 19:19:59.036198','2022-03-22 19:19:59.035883','Lead chloride (PbCl2, 99.999%, Alfa Aesar), methylammonium hydrochloride (CH3NH3Cl, 99%, Alfa Aesar), dimethylformamide (DMF) (C3H7NO, 99.5%, Merck KGaA), and dimethyl sulfoxide (DMSO) (C2H6OS, 99.7%, Sigma-Aldrich)','MAPbCl3 single crystals of size ~2.5 mm × 2 mm × 1 mm','0.2228 gm of CH3NH3Cl was dissolved in a 3.3 mL DMSO: DMF (1:1) solution using an ultrasonic bath for 10 minutes under an N2 atmosphere at room temperature. In 3 mL of the prepared CH3NH3Cl/DMSO:DMF (1:1) solution, 0.8343 g PbCl2 was added. The mixture was stirred for 20 min until the solution becomes transparent. The solution was filtered using PVDF filter. The filtrate was transferred in a vial and kept in an oil bath undisturbed at 50 °C for 6 ~8 h. After the formation of the crystals, they were dried with a nitrogen gun.',75,1942,75,1),
(1259,'2022-03-22 19:35:15.458909','2022-03-22 19:35:15.458654','Lead chloride (PbCl2, 99.999%, Alfa Aesar), methylammonium hydrochloride (CH3NH3Cl, 99%, Alfa Aesar), dimethylformamide (DMF) (C3H7NO, 99.5%, Merck KGaA), and dimethyl sulfoxide (DMSO) (C2H6OS, 99.7%, Sigma-Aldrich)','MAPbCl3 single crystals of size ~2.5 mm × 2 mm × 1 mm','0.2228 gm of CH3NH3Cl was dissolved in a 3.3 mL DMSO: DMF (1:1) solution using an ultrasonic bath for 10 minutes under an N2 atmosphere at room temperature. In 3 mL of the prepared CH3NH3Cl/DMSO:DMF (1:1) solution, 0.8343 g PbCl2 was added. The mixture was stirred for 20 min until the solution becomes transparent. The solution was filtered using PVDF filter. The filtrate was transferred in a vial and kept in an oil bath undisturbed at 50 °C for 6 ~8 h. After the formation of the crystals, they were dried with a nitrogen gun.',75,1943,75,1),
(1261,'2022-03-22 20:05:11.463596','2022-03-22 20:05:11.463353','Lead chloride (PbCl2, 99.999%, Alfa Aesar), methylammonium hydrochloride (CH3NH3Cl, 99%, Alfa Aesar), dimethylformamide (DMF) (C3H7NO, 99.5%, Merck KGaA), and dimethyl sulfoxide (DMSO) (C2H6OS, 99.7%, Sigma-Aldrich)','MAPbCl3 single crystals of size ~2.5 mm × 2 mm × 1 mm','0.2228 gm of CH3NH3Cl was dissolved in a 3.3 mL DMSO: DMF (1:1) solution using an ultrasonic bath for 10 minutes under an N2 atmosphere at room temperature. In 3 mL of the prepared CH3NH3Cl/DMSO:DMF (1:1) solution, 0.8343 g PbCl2 was added. The mixture was stirred for 20 min until the solution becomes transparent. The solution was filtered using PVDF filter. The filtrate was transferred in a vial and kept in an oil bath undisturbed at 50 °C for 6 ~8 h. After the formation of the crystals, they were dried with a nitrogen gun.',75,1945,75,1),
(1704,'2023-05-19 20:21:38.045192','2023-05-19 20:21:38.044861','Presumably (by analogy with MAPbBr3 synthesis description in same reference): 40% aqueous CH3NH2 solution; concentrated HCl(aq); Pb(NO3)2 (aq; 0.021 molar)','colorless crystals','Adapted from synthesis description of CH3NH3PbBr3 as indicated by the author.\r\nNeutralize 20g of 40% aq. CH3NH2 solution with concentrated aq. HCl.\r\nAt 100 deg. C, add aq. (0.021 mol) solution of Pb(NO3)2 by slow dripping while stirring vigorously.\r\nCrystals begin to form while stirring.\r\nSolution is filtrated after cooling to room temperature. The crystals are washed with n-butanol and subsequently benzene and are finally dried in vacuum.\r\nNominal stoichiometry: C 3.47 wt.% H 1.75 wt.% N 4.05 wt.% Pb(II) 59.95 wt.% Cl 30.77 wt.%\r\nActual stoichiometry: C 3.17 wt.% H 1.63 wt.% N 3.71 wt.% Pb(II) 60.9 wt.% Cl 31.8 wt.%',8,2277,8,1),
(1761,'2023-06-09 03:34:56.387203','2023-06-09 03:34:56.386960','PEACl salt, PbCl2 salt, stoichiometric ratio 2:1','spin-coated thin film','Starting materials dissolved in 4:1 DMF:DMSO solvent mixture, stirred for 30 min at room temperature. Substrate: Quartz substrate with 120 nm gold layer with inerdigitated fingers. Precursor solution (0.1-0.3 molar) pipetted onto substrate and spin-coated, 4000 rpm / 30 seconds, targeting film thicknesses 80-300 nm.',130,2334,130,1),
(1762,'2023-06-09 03:36:15.554393','2023-06-09 03:36:15.554131','PEACl salt, PbCl2 salt, stoichiometric ratio 2:1','spin-coated thin film','Starting materials dissolved in 4:1 DMF:DMSO solvent mixture, stirred for 30 min at room temperature. Substrate: Quartz substrate with 120 nm gold layer with inerdigitated fingers. Precursor solution (0.1-0.3 molar) pipetted onto substrate and spin-coated, 4000 rpm / 30 seconds, targeting film thicknesses 80-300 nm.',130,2335,130,1),
