(1785,'2023-07-27 02:03:35.677836','2023-07-27 02:03:35.677544','MACl salt, PbCl2 salt, stoichiometric ratio 2:1','spin-coated thin film','Starting materials dissolved in 4:1 DMF:DMSO solvent mixture, stirred for 30 min at room temperature. Substrate: Quartz substrate with 120 nm gold layer with interdigitated fingers. Precursor solution (0.1-0.3 molar) pipetted onto substrate and spin-coated, 4000 rpm / 30 seconds, targeting film thicknesses 80-300 nm.',130,2357,130,1),
